def get_centroids(array, k, a=None):
    """2d numpy of integers returns k random points
    for more information about 'a' read 2.2.1. Initial Centroid Selection
    The selection of a centroid  follows two principles:
        1) the distance between any centroid and the boundary of the domain is at least a.
        2) the distance between any two centroids is at least 2a

    Args:
        array : 2d numpy array 
        k : number of centroids
        a (default is 0): array that has the values of 'a' for every column
    Returns:
        numpy array with random centroids
    """

    number_of_rows, number_of_columns = array.shape
    # set a to be 0s if it was not provided
    if a is None:
        a = np.zeros(number_of_columns)
    
    mins = array.min(axis=0)
    maxs = array.max(axis=0)

    centroids = np.empty((k, 0), int)

    for col in range(number_of_columns):

        '''
        
        # fixing 'a' to match the data at [col]
        # if 'a' is too larg to generate centroid

        while a[col] > (maxs[col] - mins[col])//2:
            a[col] = a[col]-1

        # if 'a' can't fit k centroids
        while a[col] > ((maxs[col] - mins[col])//(k*2+2)):
            a[col] = a[col]-1
        '''
        centroid = []
        for cent in range(k):
            loop = True
            random_value = None
            # print (1)
            while loop:
                random_value = np.random.randint(mins[col], maxs[col]+1)
                loop = False
                # print (2)
            # check if the random_value follow the two principles
                # check principle between any centroid and the boundary of the domain is at least a.
                if random_value - mins[col] < a[col] or maxs[col] - random_value < a[col]:
                    loop = True
                    # print (3)
                # check if the distance between all the random valued already selected >= 2a
                used_value = False

                for old_random_value in centroid:
                    if a[col]*2 > abs(random_value - old_random_value):
                        used_value = True
                        loop = True
                        break # exit for loop

            # add the value to the point to construct a point
            centroid.append(random_value)

        # add the point to the centroids array as a column in index col
        centroids = np.append(centroids, np.array(
            [centroid]).transpose(), axis=1)

    return centroids

